ertificate</a></div><br><br><p></p>','2016-11-30 18:37:42','Y','Isi dari halaman tentang kami'),('head_meta_author','Head Meta Author','Lewat Lawet Kebumen','2016-08-29 02:15:56','N','Isi dari syntax author pada head'),('head_meta_description','Head Meta Description','Kabupaten Kebumen\r\nJawa Tengah, Indonesia\r\nVisitKebumenNow.com\r\n\r\nPeta Wisata Kebumen adalah aplikasi peta online yang berisi info lokasi wisata di Kabupaten Kebumen, Provinsi Jawa Tengah, Republik Indonesia.\r\n\r\nAplikasi ini akan membuka Peta secara Online untuk Lokasi Pariwisata di Kabupaten Kebumen. \r\n\r\nPeta Online ini memuat info hampir seluruh lokasi wisata di Kabupaten Kebumen, berupa Pantai, Curug (Air Terjun), Goa, Perbukitan, Waduk (Embung - Telaga), Wisata Pendidikan, dan Wisata lainnya yang berjumlah sekitar 123 lokasi wisata, dengan data yang akan terus diperbaharui.\r\n\r\nKunjungi Kebumen Sekarang! Visit Kebumen Now!\r\n#VisitKebumenNow #ideBuatKebumen','2016-09-01 17:11:51','N','Isi dari syntax description pada head'),('head_meta_title','Head Meta Title','Peta Wisata Kebumen','2016-08-29 14:27:34','N','Isi dari syntax title pada head'),('instagram_client_id','Instagram Client ID\n','e76f744e170c4c82b5f9bcaed9a8ca4d','2016-11-28 17:22:27','N','Client ID'),('instagram_client_secret','Instagram Client Secret','522684f36f404e309e4b82039b6bc3b0','2016-11-28 17:22:46','N','Client Secret'),('mail_account_addr','Akun Email Asal','no_reply@visitkebumennow.com',NULL,'N','Akun yang digunakan untuk Pengiriman Email'),('mail_account_name','Nama Pengirim Email','Notification - VisitKebumenNow.com','2016-09-15 19:56:24','N','Nama yang yang digunakan sebagai inisial pengirim email'),('mail_smtp_host','Host Server SMTP','smtp.sendgrid.net',NULL,'N','Host / Alamat Server SMTP yang digunakan untuk mengirim Email'),('mail_smtp_pass','Password Server SMTP','8uK4%53n','2016-11-11 23:17:19','N','Password login Server SMTP yang digunakan untuk mengirim Email'),('mail_smtp_port','Port Server SMTP','587',NULL,'N','Port login Server SMTP yang digunakan untuk mengirim Email'),('mail_smtp_user','Username Server SMTP','kungkungjazz',NULL,'N','Username login Server SMTP yang digunakan untuk mengirim Email'),('map_api','Google Maps API','AIzaSyBOmkKaTYvf7YpbsHQxhcV3Df-0IYXbETA',NULL,'N','API Key Google Maps'),('map_center_coordinat','Google Maps Center Latitude & Longitude','{lat: -7.668747, lng: 109.651771}','2016-11-18 14:40:57','N','Latitude dan Longitude Default Google Maps'),('map_zoom','Google Maps Default Zoom','13','2016-10-14 11:45:48','N','Default Zoom dari Google Maps'),('registrasi_perjanjian','Registrasi Perjanjian','<span style=\"line-height: 19.2px; font-family: Helvetica; font-size: 14px;\">Pendaftaran ini gratis untuk Kontributor Objek Wisata, Anda akan mendapatkan hak akses untuk <span style=\"text-decoration: underline;\">memperbaharui</span> dan <span style=\"text-decoration: underline;\">menambah</span> informasi Objek Wisata, Artikel Wisata, dan Foto Wisata. Nama Kontributor akan ditampilkan pada halaman utama peta ini.</span>\r\n<p><span style=\"font-family: Helvetica; font-size: 14px; line-height: 19.2px;\">Setiap kontribusi akan menghasilkan senilai poin.&nbsp;</span><span style=\"font-family: Helvetica; font-size: 14px; line-height: 19.2px;\">Dalam periode tertentu, para kontributor dengan poin tertinggi berhak mendapatkan sebuah merchandise dari tim Lewat Lawet Dengan syarat, nomor handphone kontributor sudah terverifikasi.</span></p>\r\n<hr>\r\n<p><span style=\"font-family: Helvetica; font-size: 14px; line-height: 19.2px;\">Poin yang diperoleh untuk setiap posting :<br></span></p>\r\n<table class=\"table table-bordered\">\r\n<tbody>\r\n<tr>\r\n<td><span style=\"font-weight: bold;\"><span style=\"font-size: 14px;\">Kontribusi</span><br></span></td>\r\n<td><span style=\"font-weight: bold;\"><span style=\"font-size: 14px;\">Min</span><br></span></td>\r\n<td><span style=\"font-weight: bold;\"><span style=\"font-size: 14px;\">Max</span><br></span></td>\r\n<td><span style=\"font-weight: bold;\"><span style=\"font-size: 14px;\">Keterangan</span><br></span></td>\r\n</tr>\r\n<tr>\r\n<td>Edit <span style=\"font-weight: bold;\">Objek Wisata</span><br></td>\r\n<td><span style=\"font-family: Verdana;\">1<br></span></td>\r\n<td><span style=\"font-family: Verdana;\">3<br></span></td>\r\n<td><span style=\"font-style: italic;\">Informasi yang valid.<br></span></td>\r\n</tr>\r\n<tr>\r\n<td>Upload <span style=\"font-weight: bold;\">Foto</span><br></td>\r\n<td><span style=\"font-family: Verdana;\">1<br></span></td>\r\n<td><span style=\"font-family: Verdana;\">5<br></span></td>\r\n<td><span style=\"font-style: italic;\">Foto yang informatif.<br></span></td>\r\n</tr>\r\n<tr>\r\n<td>Tulis <span style=\"font-weight: bold;\">Artikel</span><br></td>\r\n<td><span style=\"font-family: Verdana;\">5<br></span></td>\r\n<td><span style=\"font-family: Verdana;\">10<br></span></td>\r\n<td><span style=\"font-style: italic;\">Artikel yang bermanfaat.<br></span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n','2016-12-14 20:09:08','Y','Informasi perjanjian saat pendaftaran antara calon Kontributor dengan Pihak Anda.'),('registrasi_perjanjian_partners','Registrasi Perjanjian Partners','<p>Sebagai pemilik usaha, Anda dapat mempromosikan usaha Anda ke dalam peta online ini. Silahkan register sebagai <span style=\"font-weight: bold;\">Partners</span> dan lengkapi informasi usaha Anda. Hal yang paling utama dari peta online ini adalah Anda harus mengatur koordinat lokasi usaha Anda dengan benar.</p>\r\n<p>Jika masih mengalami kendala, silahkan hubungi kami melalui tombol di bawah ini.</p>\r\n<div style=\"text-align: center;\"><a href=\"https://visitkebumennow.com/hubungi\" class=\"btn btn-primary btn-info\"><span class=\"glyphicon glyphicon-ok\"></span> Hubungi Kami</a></div><br><br>','2016-11-30 17:52:14','Y','Informasi perjanjian saat pendaftaran antara calon Partners dengan Pihak Anda. Jelaskan pula hak dan kewajiban partners disini.\n'),('s