  `kategori_id` int(11) DEFAULT NULL,
  `lokasi_koordinat` varchar(50) DEFAULT NULL,
  `lokasi_desa` varchar(100) DEFAULT NULL,
  `lokasi_kecamatan` varchar(100) DEFAULT NULL,
  `lokasi_kabupaten_kota` varchar(100) DEFAULT NULL,
  `info_tiket` text,
  `info_tempat_ibadah` text,
  `info_penginapan` text,
  `info_toilet` text,
  `info_akses_jalan` text,
  `info_deskripsi` text,
  `kontak_handphone` varchar(13) DEFAULT NULL,
  `kontak_website` varchar(50) DEFAULT NULL,
  `kontak_email` varchar(50) DEFAULT NULL,
  `kontak_facebook` varchar(50) DEFAULT NULL,
  `kontak_twitter` varchar(50) DEFAULT NULL,
  `kontak_instagram` varchar(50) DEFAULT NULL,
  `terakhir_update` datetime DEFAULT NULL,
  `foto` varchar(250) DEFAULT NULL,
  `user_id` int(11) DEFAULT NULL,
  `status` enum('Publish','Moderasi','Draft','') DEFAULT NULL,
  `moderasi_keterangan` text,
  `moderasi_user_id` int(11) DEFAULT NULL COMMENT 'referensi dari user.user_id',
