  `akomodasi_maks_waktu_tayang` datetime DEFAULT NULL,
  `street_view_url` text,
  PRIMARY KEY (`objek_id`)
) ENGINE=InnoDB AUTO_INCREMENT=147 DEFAULT CHARSET=latin1;
