INSERT INTO `objek` (`objek_id`, `nama`, `kategori_id`, `lokasi_koordinat`, `lokasi_desa`, `lokasi_kecamatan`, `lokasi_kabupaten_kota`, `info_tiket`, `info_tempat_ibadah`, `info_penginapan`, `info_toilet`, `info_akses_jalan`, `info_deskripsi`, `kontak_handphone`, `kontak_website`, `kontak_email`, `kontak_facebook`, `kontak_twitter`, `kontak_instagram`, `terakhir_update`, `foto`, `user_id`, `status`, `moderasi_keterangan`, `moderasi_user_id`, `moderasi_waktu`, `url_seo`, `lat`, `lng`, `duplikat_dari_id`, `akomodasi_layanan_tambahan`, `akomodasi_jasa`, `akomodasi_maks_waktu_tayang`, `street_view_url`) VALUES (1,'Pantai Ambal',1,'{lat:-7.804286,lng:109.720695}','Entak','Ambal','Kab. Kebumen','Dewasa Rp 2.000\r\nAnak - Anak Rp 1.000','Ada','(data belum tersedia)','Ada','Baik','Pantai Ambal merupakan pantai yang belum banyak diketahui oleh banyak orang. Pesona yang dimiliki oleh Pantai Ambal tidak jauh beda dari Pantai yang lainnya. Jajanan yang terkenal di pesisir Pantai Ambal adalah sate Ambal yang bumbunya terbuat dari tempe bukan kacang atau kecap.','','','','','','','2016-08-31 12:16:22','default.png',1,'Publish',NULL,NULL,'0000-00-00 00:00:00','pantai-ambal',-7.80429,109.721,0,NULL,NULL,NULL,''),(2,'Pantai Ayah',1,'{lat:-7.723973,lng:109.39427}','Ayah','Ayah','Kab. Kebumen','Dewasa Rp 4.000 Anak 0-5 Rp 2.000','Ada.','Ada.','Ada.','Baik','Pantai Logending atau Pantai Ayah menyajikan panorama tersendiri yaitu memiliki wisata hutan Logending dan wisata bahari. Di tempat ini Anda juga bisa bermain sepak bola, voli pantai ataupun hanya berjalan jalan menikmati keindahan alam sekitar. Tidak jauh dari lokasi terdapat Hutan Wisata Logending dimana Anda dapat berkemah di kawasan hutan yang di dominasi pohon jati tersebut. ',NULL,NULL,NULL,NULL,NULL,NULL,'2016-08-10 23:38:20',NULL,1,'Publish',NULL,NULL,'0000-00-00 00:00:00','pantai-ayah',-7.72397,109.394,0,NULL,NULL,NULL,''),(3,'Pantai Bocor',1,'{lat:-7.792274,lng:109.663609}','Setrojenar','Buluspesantren','Kab. Kebumen','Umum : Rp 2,000','Ada','(data belum tersedia)','Ada','Baik','Pantai Bocor adalah pantai yang belum terkenal. Di tepi pantai juga terdapat arena bermain untuk anak anak dan juga disekitarnya terdapat warung warung. Ombak di Pantai ini lumayan besar jadi berhati hatilah ketika bermain.',NULL,NULL,NULL,NULL,NULL,NULL,'2016-08-10 23:38:20',NULL,1,'Publish',NULL,NULL,'0000-00-00 00:00:00','pantai-bocor',-7.79227,109.664,0,NULL,NULL,NULL,''),(4,'Pantai Bopong',1,'{lat:-7.764817,lng:109.518564}','Surorejan','Puring','Kab. Kebumen','Roda 2 : Rp 2,000 Roda 4 : Rp 5,000','Tidak Ada','Tidak Ada','Tidak Ada','Baik','Pantai Bopong memiliki pasir pantai berwarna hitam. Pantai ini hampir mirip dengan Pantai Laguna Lambupurwo. Pantai ini merupakan pantai yang dijadikan spot bagi penyu untuk bertelur dan berkembang biak. Pemandangan laut yang berpadu dengan pohon cemara yang rindang serta pasir yang hitam kecoklatan adalah panorama yang indah yang dimiliki pantai ini. ',NULL,NULL,NULL,NULL,NULL,NULL,'2016-08-10 23:38:20',NULL,1,'Publish','',1,'2016-07-30 15:53:09','pantai-bopong',-7.76482,109.519,0,NULL,NULL,NULL,''),(5,'Pantai Brecong',1,'{lat:-7.793614,lng:109.671407}','Brecong','Buluspesantren','Kab. Kebumen','Dewasa Rp 2,000 Anak anak Rp 1,000','(data belum tersedia)','(data belum tersedia)','(data belum tersedia)','Baik','Pantai Brecong menyuguhkan panorama tersendiri, yaitu terdapat cagar budaya petilasan Joko Sangkrib yang terletak sekitar 200 m dari bibir pantai. Tidak jauh dari tempat tersebut, terdapat pula pendopo bekas bupati jaman dahulu. ',NULL,NULL,NULL,NULL,NULL,NULL,'2016-08-10 23:38:20',NULL,1,'Publish',NULL,NULL,'0000-00-00 00:00:00','pantai-brecong',-7.79361,109.671,0,NULL,NULL,NULL,''),(6,'Pantai Criwik',1,'{lat:-7.760044,lng:109.481302}','Tambakmulya','Puring','Kab. Kebumen','(data belum tersedia)','Ada','(data belum tersedia)','Ada','Baik','Panti Criwik ini pantai yang bersih dan alami. Ditempat ini banyak pohon pohon rindang yang tumbuh. Dan juga tempat ini terkadang dijadikan sebagai foto preweding dengan latar belakang pohon pohon yang berjajar yang membuat teduh.',NULL,NULL,NULL,NULL,NULL,NULL,'2016-08-10 23:38:20',NULL,1,'Publish',NULL,NULL,'0000-00-00 00:00:00','pantai-criwik',-7.76004,109.481,0,NULL,NULL,NULL,''),(7,'Pantai Gebyuran',1,'{lat:-7.773923,lng:109.433512}','Pasir','Ayah','Kab. Kebumen','Wana Bahari Pasir Indah Rp.10.000 /orang Parkir: Roda 2 Rp.2000 Roda 4 Rp.5000 *(harga tiket masuk meliputi kawasan sbb: Pantai TPI Pasir, Pantai Lampon, Pantai Gebyuran, Pantai Surumanis, Goa Worawari, Goa Celeng, Goa Silumbung, Pantai Tanjung Karang Pengantin.) GRATIS penggunaan payung payung area foto selfie. Tiket Rp 5.000 (berasuransi) Parkir: Roda 2 Rp 2.000 Roda 4 Rp 5.000','Tidak Ada','Tidak Ada','Tidak Ada','Rusak','<p>Goa Wara Wiri merupakan goa yang berasal dari kerajaan jaman dulu. Goa ini pernah menjadi tempat singgah dan berlindung dari serangan penjajah Belanda dan Jepang. Goa ini juga memiliki keunikan, salah satunya adalah ketika dipukul akan berbunyi seperti gamelan.<br><br>Sewa Tenda Camp, Tour Guide, Booking Area, hubungi:<br>082135517009, 085647723710</p>\r\n<p><br></p>','082135517009','http://www.pasirindah.com','','','','','2016-11-07 17:40:49',NULL,1,'Publish',NULL,NULL,'0000-00-00 00:00:00','pantai-gebyuran',-7.77392,109.434,0,NULL,NULL,NULL,''),(8,'Pantai Karang Agung',1,'{lat:-7.739735,lng:109.387575}','Argopeni','Ayah','Kab. Kebumen','Gratis','Tidak Ada','Tidak Ada','Tidak Ada','Rusak','Pantai Karang Agung memiliki keindahan tersendiri yaitu memiliki karang tinggi yang terpisah dari dataran jika air laut pasang. Banyak orang menyebutnya sebagai Tanah Lotnya Kebumen. Bebatuan kecil yang ada disekitar pantai berpadu dengan ombak serta angin laut yang sejuk merupakan kombinasi terbaik di pantai ini.',NULL,NULL,NULL,NULL,NULL,NULL,'2016-08-10 23:38:20',NULL,1,'Publish',NULL,NULL,'0000-00-00 00:00:00','pantai-karang-agung',-7.73974,109.388,0,NULL,NULL,NULL,''),(9,'Pantai Karang Bolong',1,'{lat:-7.75