ni.',NULL,NULL,NULL,NULL,NULL,NULL,'2016-08-10 23:38:20',NULL,1,'Publish',NULL,NULL,'0000-00-00 00:00:00','pantai-suwuk',-7.75875,109.471,0,NULL,NULL,NULL,''),(22,'Pantai Tanjung Karang Penganten',1,'{lat:-7.775216,lng:109.433775}','Pasir','Ayah','Kab. Kebumen','Wana Bahari Pasir Indah Rp.10.000 /orang Parkir: Roda 2 Rp.2000 Roda 4 Rp.5000 *(harga tiket masuk meliputi kawasan sbb: Pantai TPI Pasir, Pantai Lampon, Pantai Gebyuran, Pantai Surumanis, Goa Worawari, Goa Celeng, Goa Silumbung, Pantai Tanjung Karang Pengantin.) GRATIS penggunaan payung payung area foto selfie. Tiket Rp 5.000 (berasuransi) Parkir: Roda 2 Rp 2.000 Roda 4 Rp 5.000','Tidak Ada','Tidak Ada','Tidak Ada','Rusak','<p>Pantai Karang Penganten ini unik karena dipercaya jika ada pasangan yang hendak menikah kemudian datang ke pantai ini maka pernikahan mereka gagal. Di pantai ini bisa juga untuk camp dan dapat menikmati sunrise yang indah.</p><p><span style=\"line-height: 1.42857;\">Sewa Tenda Camp,&nbsp;</span><span style=\"line-height: 1.42857;\">Tour Guide,&nbsp;</span><span style=\"line-height: 1.42857;\">Booking Area, h</span><span style=\"line-height: 1.42857;\">ubungi:<br></span><span style=\"line-height: 1.42857;\">082135517009,&nbsp;</span><span style=\"line-height: 1.42857;\">085647723710</span><br></p>','082135517009','http://www.pasirindah.com','','','','','2016-08-19 09:37:46',NULL,1,'Publish',NULL,NULL,'0000-00-00 00:00:00','pantai-tanjung-karang-penganten',-7.77522,109.434,0,NULL,NULL,NULL,''),(23,'Pantai Watu Kranjang',1,'{lat:-7.735954,lng:109.388992}','Argopeni','Ayah','Kab. Kebumen','Gratis','Tidak Ada','Homestay Pak Darno ( diluar lokasi)','Tidak Ada','Rusak','Pantai Watu Keranjang ini lokasinya berdekatan dengan Pantai Wedi Putih dan berada di sebelah barat Pantai Karang Agung. Meski tidak berpasir dan banyak karang karang, namun itu menjadi keunikan dari pantai ini.',NULL,NULL,NULL,NULL,NULL,NULL,'2016-08-10 23:38:20',NULL,1,'Publish',NULL,NULL,'0000-00-00 00:00:00','pantai-watu-