INSERT INTO `objek_detail_artikel` (`artikel_id`, `objek_id`, `user_id`, `judul`, `singkat`, `isi`, `tgl_posting`, `terakhir_update`, `url_seo`, `foto`, `status`, `moderasi_keterangan`, `moderasi_user_id`, `moderasi_waktu`) VALUES (1,57,1,'Menyusuri Goa tanpa Terluka  : Tips Caving untuk Pemula','Caving atau menyusuri goa  merupakan salah satu jenis wisata khusus sekaligus olahraga yang sangat diminati oleh para wisatawan akhir-akhir ini. Katanya kalau sudah caving itu sudah sah jadi anak alam.','<p>Sayangnya, sosialiasi caving masih kurang <span style=\"font-style: italic;\">“hits”</span> jika dibandingkan dengan hiking atau naik gunung, padahal caving sendiri merupakan kegiatan yang sangat seru dan menantang yang pasti bikin kalian ketagihan.</p><p>Banyak orang yang mengira kalau caving ini berbahaya dan rawan kecelakaan. Oleh karena itu, saat ini setiap goa yang membuka wisata caving pasti memiliki kelompok pemandu wisata yang profesional dan menyediakan peralatan caving yang dibutuhkan oleh para wisatawan. Banyak sekali contoh wisata caving yang bisa ditemui di Indonesia, misalnya saja : Goa Pindul dan Goa Jomblang di Yogyakarta, dan di Kebumen juga ada Goa Barat yang terkenal dengan air terjun di dalam goanya.</p><p>Untuk kalian yang ingin mencoba menikmati caving, khususnya pagi para pemula dan yang baru berniat untuk caving, berikut kami bagikan sedikit tips untuk bisa menjelajahi goa tanpa takut terluka.</p><h4>Tips Caving untuk Pemula : </h4><h6>1.&nbsp;&nbsp; &nbsp;Pilih paket Caving dengan Personal Trainer / Pemandu</h6><p>Banyak sekali Goa yang bisa kita temukan di Indonesia, mungkin semua goa itu bisa disusuri, namun tidak semua goa ini aman. Sebelum memutuskan untuk pergi caving, pastikan tujuan caving kamu sudah terbukti aman dan sudah memiliki kelompok pemandu caving yang profesional. Kalau di Goa Barat (Kebumen) sudah memiliki pemandu yang keren dan bertanggung jawab atas keselamatan kamu.<br><br></p><h6>2.&nbsp;&nbsp; &nbsp;Gunakan Peralatan Caving dengan Benar</h6><p>Kalau mau menikmati alam, maka nikmatilah dengan bijak. Harus selalu di ingat bahwa the power of earth is always bigger than the human power, alias kekuatan yang dimiliki oleh alam selalu lebih besar dari kekuatan manusia. Tentu kita tidak ingin hal-hal yang buruk terjadi pada kita, kan? Nah, maka dari itu baiknya kita tetap selalu menjaga keselamatan, salah satunya dengan memakai peralatan pendukung caving yang lengkap dan dipakai dengan benar. Biasanya, caving memerlukan cukup banyak alat, namun jangan mengeluh karena itu memang sangat penting. </p><p>Contohnya jika caving kita harus menggunakan hard-hat atau topi yang keras seperti pekerja bangunan itu, lalu menggunakan head lamp karena di dalam goa pasti gelap, mengenakan sepatu khusus, pelampung dan tali pengaman. Pastikan kamu sudah mengenakan semuanya dengan benar yaa supaya selalu aman, ingat untuk selalu waspada dan menjaga diri.</p><h6>3.&nbsp;&nbsp; &nbsp;Ikuti Instruksi Pemandu </h6><p>Saat caving sedang berlangsung, biasanya para pemandu akan memberikan beberapa instruksi tentang apa yag harus kita lakukan. Misalnya perintah untuk merunduk, berhenti sejenak, peringatan jalan yang licin, atau tentang objek yang sedang kita lewati. Mengikuti instruksi dari pemandu ini sangat penting kalau kita ingin selamat sampai keluar dari goa, hehe..</p><p>Tips nomor 3 ini sangat penting untuk semua yang pemula maupun yang sudah sering caving, karena meski sudah sering caving, kita harus paham bahwa kriteria goa satu dengan yang lainnya berbeda-beda sehingga tetap harus waspada terhadap keadaan sekitar dan pasang telinga supaya bisa dengar peringatan dari pemandu.<br><br></p><h6>4.&nbsp;&nbsp; &nbsp;Siapkan Kesehatan Fisik dan Mental</h6><p>Caving memang jenis wisata yang menyenangkan, tapi caving perlu persiapan fisik yang matang. Memakai banyak alat di tubuh dan berjalan menyusuri goa dalam keadaan yang lembab akan menguras habis tenagamu. Sedikit gambaran saja, caving berarti kalian akan menyusuri goa yang gelap dan dingin, dan di beberapa goa, jalur susur goa ini bisa jadi harus melewati sungai bawah tanah, artinya siap-siap untuk basah sekujur tubuh ya! <br>Belum lagi jika jalur susur gua ini panjang dan jaraknya bisa mencapai hitungan kilometer, jika fisik dan mental tak mampu, nanti bisa-bisa menyerah sebelum sampai tujuan dong, hehe. Sebelum pergi caving, perbanyak latihan fisik ringan seperti jogging, push up, sit up atau squad.<br><br></p><h6>5.&nbsp;&nbsp; &nbsp;Buat Reservasi sebelum Caving</h6><p>Tips nomor 5 ini terdengar sepele ya? Padahal ini super penting lhoh! Kalian harus tahu bahwa tidak semua goa membuka jalur caving untuk umum. Ada goa yang memang sudah lazim jadi tujuan wisata seperti Goa Pindul yang tidak membatasi jumlah pengunjung sehingga kamu bisa datang kapan saja tanpa reservasi, namun untuk beberapa goa yang lebih private misalnya Goa Barat di Kebumen, harus melakukan reservasi dulu supaya kamu bisa menikmatinya. Goa Barat sangat menjaga keindahan objek stalaktit dan stalakmitnya sehingga pengunjung yang akan melakukan caving dibatasi jumlahnya. Sebelum datang ke objek wisata ada baiknya browsing dulu tentang aturan kunjungannya.<br><br>Tips diatas bisa diterapkan untuk kalian semua yang akan melakukan caving, ingat ya untuk selalu menjaga alam dan menjaga keselamatan diri saat jalan-jalan ke alam. <span style=\"font-style: italic;\">Safety First, Selfie Later!</span><br><br><br></p>','2016-11-03 17:39:39','2016-11-03 17:39:39','menyusuri-goa-tanpa-terluka-tips-caving-untuk-pemula','goa-barat.jpg','Publish','Terima kasih!',1,'2016-11-03 17:35:00'),(2,83,20,'Keindahan Alam dari Atas Bukit','Sekedar mau cerita pengalaman kalo dulu pernah kesana.. trus kasih opini sendiri deh. Opini setiap orang boleh berbeda ya.. jadi selo aja :)','<p>Akses menuju bukit ini lumayan mudah, tapi yang namanya bukit ya pasti harus mendaki ya.. hehe. Tenang, buat kalian yg gak kuat mendaki karena capek, di sana ada ojek gunung kok. Ojek ini dibandrol harga sekitar 5-10rb. But, gak asik dong kalo main ke bukit gak ndaki ndaki gitu :/ . Rasa lelah itu akan terbayarkan sob, setelah sampai di atas wuihhh pemandangannya... Kita bisa liat Pantai Karangbolong, Suwuk, Criwik, Bopong, Petanahan pokoknya sejauh mata memandang itu pantai guys. Kuat kuatin aja mandangnya mau sampai kemana. Nah setelah pemandangan pantai di sebelah timur, lain lagi di sebelah barat. Kita bisa liat bukit bukit gtu deh. Tempat ini cocok lah buat ngliat sunrise/sunset. Tapi aku pribadi lebih suka sunrisenya, apalagi klo dapat golden sunrise.. ultra rejeki deh. :v Diantara kabut.. sejuknya pagi, anget lagi kena sinar matahari :\'v Kalian gak perlu dateng pagi pagi banget kok. Naik dari bawah ke atas sekitar 30 menitan. Dan lagi jalan sebelah barat udah bisa pake motor, tapi hati hati ya guys, klo pagi jalan setapaknya licin. Tinggal liat perkiraan waktu sunrise jam berapa, jarak rumah kamu ke objek nya berapa, trus kira kira waktunya dong.. Kasih target juga harus sampe di obwis jam berapa. Woke, sekian dari saya *tadi aku sekarang pake saya :\'v. Gapapa ya readers, maaf ya kalo sok asik :\'v Bye.. :*</p>','2016-12-03 05:36:10',NULL,'keindahan-alam-dari-atas-bukit',NULL,'Publish','Mantapf..!!',1,'2016-12-05 17:59:56');
