INSERT INTO `sms_templates` (`templates_id`, `nama`, `isi`, `keterangan`, `terakhir_update`, `aktif`) VALUES ('konten_draft','Konten Draft','Hai {nama_kontributor},\r\nMaaf, kontribusi {jenis_konten} Anda belum layak publikasi.\r\nLogin di VisitKebumenNow.com segera utk perbaiki.\r\nTerima kasih','SMS yang digunakan untuk memberikan informasi bahwa konten (Objek / Artikel / Foto) tidak lolos moderasi.','2016-11-03 17:32:34','Y'),('notifikasi_moderasi_user','Notifikasi Moderasi User','Hai {nama_user}, pada {tanggal} kami telah melakukan moderasi dan menyatakan bahwa akun anda saat ini {status}.','Digunakan untuk mengirimkan SMS notifikasi kepada user setelah dilakukan moderasi','2016-10-08 23:45:09','Y'),('notifikasi_registrasi_administrator','Notifikasi Registrasi Administrator','Hai administrator, seseorang bernama {nama_kontributor} melakukan pendaftaran.','Digunakan untuk mengirimkan SMS notifikasi kepada administrator ketika ada user yang sedang melakukan pendaftaran','2016-12-09 11:50:51','N'),('notifikasi_registrasi_administrator_partners','Notifikasi Registrasi Administrator (Partners)','Hai administrator, seseorang bernama {nama_partners} melakukan pendaftaran.','Digunakan untuk mengirimkan SMS notifikasi kepada administrator ketika ada partners yang sedang melakukan pendaftaran','2016-12-09 11:50:58','N'),('notifikasi_registrasi_kontributor','Notifikasi Registrasi Kontributor','Hai {nama_kontributor}, terima kasih telah melakukan pendaftaran di VisitKebumenNow.com. Sekarang Anda sudah bisa LOGIN menggunakan email & password Anda.','Digunakan untuk mengirimkan SMS notifikasi kepada kontributor pada saat melakukan pendaftaran','2016-10-21 19:13:40','Y'),('notifikasi_registrasi_partners','Notifikasi Registrasi Partners','Hai {nama_partners}, terima kasih telah melakukan pendaftaran.','Digunakan untuk mengirimkan SMS notifikasi kepada partner pada saat melakukan pendaftaran','2016-11-10 11:42:10','Y'),('poin_kontribusi','Poin Kontribusi','Hai {nama_kontributor},\r\nPada {tanggal} poin Anda bertambah {poin}.\r\nLogin Peta Wisata (VisitKebumenNow.com) utk lihat poin.\r\nTerima kasih','SMS yang digunakan untuk memberikan informasi untuk poin yang diperoleh dari verifikasi Konten (Objek / Artikel / Foto).','2016-11-03 17:32:15','Y'),('status_user','Status User','Hai {nama_user},\r\nMulai {tanggal}, status akun Anda di Peta Wisata Kebumen (VisitKebumenNow.com) adalah: {status}.\r\nTerima kasih','Digunakan untuk mengirim SMS Notifikasi pemberitahuan status akun user.','2016-08-30 22:27:36','Y'),('verifikasi_no_hp_user','Verifikasi No Handphone User','Kode Anda: {kode_verifikasi}\r\n(VisitKebumenNow.com).\r\nTerima kasih','Digunakan untuk mengirim SMS verifikasi no handphone kepada user.','2016-09-06 16:21:25','Y'),('verifikasi_register_user','Verifikasi Pendaftaran','Kode Anda: {kode_verifikasi}\r\nMasukkan kode ini segera! (maks. 2 jam).\r\nKunjungi di Peta Wisata Kebumen (VisitKebumenNow.com).\r\nTerima kasih','Digunakan untuk mengirim SMS verifikasi kepada user pada saat pendaftaran.','2016-10-08 23:52:40','N');
